import { main } from '../index';

const x = [0.5, 1, 1.5, 2, 2.5];
const y = [0, 1, 1.5, 5, 6];

const expectedDataURL = "data:image/png;base64,"

const mockData = x.map((xValue, index) => ({
  x: xValue,
  y: y[index]
}));

jest.mock('node-fetch', () => ({
  __esModule: true,
  default: async () => ({ json: async () => mockData })
}))

describe('index.ts', () => {
  it('should correctly run regression', async () => {
    const [regressionResult, renderResult] = await main();

    expect(regressionResult.intercept).toEqual(-2.1000000000000005);
    expect(regressionResult.slope).toEqual(3.2);
    expect(renderResult).toEqual(expectedDataURL);
  });
});